import React, { Component } from 'react';
import { Card, CardContent, Typography, Grid } from '@material-ui/core';


const PharmacyList = ({ data : { eczane_adi, eczane_ilce }}) => {
  return(
      <div>
        <ul>
          <li>{data.eczane_adi}</li>
        </ul>
      </div>
  )
}

 

 export default PharmacyList;
